import ExpenseItem from "./ExpenseItem"
import './ExpenseItem'

export default function ExpenseItems(props) {

return (
    <>
        {props.items.map((item, index) => 
        
            <ExpenseItem key={index} title={item.title} amount={item.amount} date={item.date} />
        )}
    </>
    )
}
